use crate::solver::Solver;

#[derive(Default, Debug)]
pub struct Solution {
    input: String,
}

fn reacted_count(input: &str) -> usize {
    let chars = input.chars().collect::<Vec<char>>();
    let mut reacted: Vec<char> = vec![];

    chars.iter().for_each(|c| {
        if let Some(frst) = reacted.last() {
            let scnd = c;
            if frst != scnd && frst.to_ascii_lowercase() == scnd.to_ascii_lowercase() {
                reacted.pop();
                return;
            }
        }

        reacted.push(*c);
    });

    reacted.len()
}

impl Solver for Solution {
    fn get_input(&self) -> &'static str {
        INPUT
    }

    fn with_input(&mut self, input: &str) {
        self.input = input.to_owned();
    }

    fn solve_part1(&self) -> String {
        reacted_count(&self.input).to_string()
    }

    fn solve_part2(&self) -> String {
        ('a'..='z')
            .map(|c| {
                let input = self
                    .input
                    .chars()
                    .filter(|&x| x.to_ascii_lowercase() != c)
                    .collect::<String>();
                reacted_count(&input)
            })
            .min()
            .unwrap()
            .to_string()
    }
}

#[cfg(test)]
mod test {
    use super::*;

    fn get_example_input<'a>() -> &'a str {
        "dabAcCaCBAcCcaDA"
    }

    #[test]
    fn test_solution_example1() {
        let mut solver = Solution::default();
        solver.with_input(get_example_input());
        let solution = solver.solve_part1();
        assert_eq!(solution, "10");
    }

    #[test]
    fn test_solution_example2() {
        let mut solver = Solution::default();
        solver.with_input(get_example_input());
        let solution = solver.solve_part2();
        assert_eq!(solution, "4");
    }

    #[test]
    fn test_solution_part1() {
        let mut solver = Solution::default();
        solver.with_input(solver.get_input());
        let solution = solver.solve_part1();
        assert_eq!(solution, "11814");
    }

    #[test]
    fn test_solution_part2() {
        let mut solver = Solution::default();
        solver.with_input(solver.get_input());
        let solution = solver.solve_part2();
        assert_eq!(solution, "");
    }
}

const INPUT: &str = "";
